// import logo from './logo.svg';
import Tabs from 'react-bootstrap/Tabs'
import Tab from 'react-bootstrap/Tab'
import "../styles/ThreeTabs.css"
import CategoriesTable from './CategoryTable';
import BooksTable from './BooksTable';
import AuthorsTable from './AuthorsTabel';
import axios from 'axios';
import { useState } from 'react';

function ThreeTabs() {
  // const [data,setdata] = useState([]);
  const getCategoriesData=()=>{
    console.log("clicked..");
    // axios.get('http://localhost:3001/categories').then(response => {
    //   // const{id,name}
    // console.log(...response.data)});
    const data = axios.get('http://localhost:3001/categories');
    ;
  }
  return (
    <div className="">
      <Tabs
        defaultActiveKey="first"
        transition={false}
        id="threeTabs"
        className="tabs"
        >

  <Tab eventKey="first" title="Categories" onClick={getCategoriesData} >
    <button className='categoryPlusBtn btn btn-success me-md-2 rounded-circle'><i className="fa fa-plus"></i></button>
    < CategoriesTable />
  </Tab>

  <Tab eventKey="second" title="Books">
    <button className='booksPlusBtn btn btn-success me-md-2 rounded-circle'><i className="fa fa-plus"></i></button>
    < BooksTable/>
  </Tab>

  <Tab eventKey="third" title="Authors" >
    <button className='authorsPlusBtn btn btn-success me-md-2 rounded-circle'><i className="fa fa-plus"></i></button>
    < AuthorsTable/>
  </Tab>
</Tabs>
    </div>
  );
}

export default ThreeTabs;
